import React, { Component } from 'react';

const UserPost = (props) => {
  return ( 
    <div className="card">
      {props.post.map(post => (
        <div className="card">
          <div className="card-body">
            post.content
          </div>
        </div>
    ))}
    </div>
    
  );
}
 
export default UserPost;
